import React from 'react';
import Header from '../../components/header/header';
import Footer from '../../components/footer/footer';
import './landing.sass'
import {Link} from "react-router-dom";

var Landing = () => {



    var hList = [
        <li><Link to="/about">About</Link></li>,
        <li><Link to="/pricing">Pricing</Link></li>,
        <li><Link to="/login"><span style={{color: "#ED6A5A"}}>Login</span></Link></li>,
        <li><Link to="/sign_up">Sign Up</Link></li>
    ];

    var body = () => {
        return(
            <div class="body" id="landing">
                <h2 id="tagline"><span style={{color: "#ED6A5A"}}>Torch.fyi</span>, the talent repository.</h2>
                <h3>Who are you?</h3>
                <div id="portalSelection">
                <h3><span style={{color: "#ED6A5A"}}>I'm the...</span></h3>
                    <div id="portalButtons">
                        <Link to="/create_talent"><button>Talent</button></Link>
                        <h4>or</h4>
                        <Link to="/ff"><button>Talent Seeker</button></Link>
                    </div>
                </div>

            </div>
        )
    }

    return(
        <div>
            <Header list = {hList}/>
            {body()}
            <Footer/>
        </div>
    )
}

export default Landing;
